import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  resItemWrapper: {
    flexDirection: "column",
    alignItems: "center",
    padding: 10,
    marginTop: 20
  },
  itemImg: {
    height: 180,
    width: '100%',
    borderRadius: 20
  },
  heartIcon: {
    position: "absolute",
    top: 20,
    right: 20
  }
});

export default styles;
